      ""name"": ""The Job"",
      ""overview"": ""After Pam's outburst at Beach Day, she and Jim had a talk and realized how much they both missed their friendship. Pam never regretted her speech she gave to Jim in front of the rest of the staff; in fact, she was happy that it only took her three years to summon the courage to say what was on her mind."",
